public SingleTokenTokenStream(Token token) {
  super(Token.TOKEN_ATTRIBUTE_FACTORY);

  assert token != null;
  this.singleToken = (Token) token.clone();

  tokenAtt = (AttributeImpl) addAttribute(TermAttribute.class);
  assert (tokenAtt instanceof Token);
}

